import { useState } from "react";
import {
  getRegularShiftByUserId,
  requestAvailability,
  requestTimeOff,
  cancelTimeOff,
  checkIn,
  checkOut
} from "../../api/peopleApi";

const DAYS = [
  "Sunday","Monday","Tuesday",
  "Wednesday","Thursday","Friday","Saturday"
];

function StaffDashboard() {
  const [userId, setUserId] = useState("");
  const [regular, setRegular] = useState([]);
  const [loading, setLoading] = useState(false);

  /* ===== FORM STATES ===== */
  const [date, setDate] = useState("");
  const [start, setStart] = useState("");
  const [end, setEnd] = useState("");

  const loadSchedule = async () => {
    if (!userId) return;
    setLoading(true);
    try {
      const data = await getRegularShiftByUserId(userId);
      setRegular(Array.isArray(data) ? data : []);
    } catch {
      setRegular([]);
    }
    setLoading(false);
  };

  return (
    <div style={{ maxWidth: 1100 }}>
      <h2>üë∑ Staff Dashboard</h2>

      {/* USER */}
      <input
        placeholder="User ID"
        value={userId}
        onChange={e => setUserId(e.target.value)}
      />
      <button onClick={loadSchedule}>Load Schedule</button>

      {/* ===== REGULAR SHIFTS ===== */}
      <h3>üîÅ Regular Weekly Shifts</h3>
      <table border="1" width="100%" cellPadding="6">
        <thead>
          <tr>
            <th>Day</th>
            <th>Start</th>
            <th>End</th>
          </tr>
        </thead>
        <tbody>
          {regular.length === 0 && (
            <tr><td colSpan="3" align="center">No shifts</td></tr>
          )}
          {regular.map((r, i) => (
            <tr key={i}>
              <td>{DAYS[r.dayOfWeek]}</td>
              <td>{r.startTime}</td>
              <td>{r.endTime}</td>
            </tr>
          ))}
        </tbody>
      </table>

      {/* ===== WORK HOURS ===== */}
      <h3>‚è±Ô∏è Work Hours</h3>
      <button onClick={() => checkIn(userId)}>üü¢ Check In</button>{" "}
      <button onClick={() => checkOut(userId)}>üî¥ Check Out</button>

      {/* ===== AVAILABILITY ===== */}
      <h3>üïí Availability Request</h3>
      <input type="date" onChange={e => setDate(e.target.value)} />
      <input type="time" onChange={e => setStart(e.target.value)} />
      <input type="time" onChange={e => setEnd(e.target.value)} />
      <br /><br />
      <button onClick={() =>
        requestAvailability(userId, date, start, end)
      }>
        Submit Availability
      </button>

      {/* ===== TIME OFF ===== */}
      <h3>üõë Time-Off Request</h3>
      <button onClick={() =>
        requestTimeOff(userId, date, start, end)
      }>
        Request Time-Off
      </button>{" "}
      <button onClick={() =>
        cancelTimeOff(userId, date, start)
      }>
        Cancel Time-Off
      </button>
    </div>
  );
}

export default StaffDashboard;
